import './App.css';
import Navbar from './components/Navbar';
import Add from './components/Add';

function App() {
  return (
    <div className="App">
  <Navbar/>
  <Routes>
    <Route path='/' element={<Add/>}></Route>
  </Routes>
    </div>
  );
}

export default App;
